let {
    setCoords,
    getXcoord,
    getYcoord,
    getValue,
    setValue
} = ggbApplet;

let game = {
    pathDistance: 4.3 - 0.7,
    hedgehog: {
        get position() { return { x: getXcoord("C"), y: getYcoord("C") } },
        set position({x, y}) { setCoords("C", x, y) },
        get rotation() { return getValue("rotation") },
        set rotation(degree) { setValue("rotation", degree) },
        get orientation() { return getValue("orientation") },
        set orientation(num) { setValue("orientation", num) },
        get speed() { return getValue("speed") },
        set speed(val) { setValue("speed", val) },
        get slide() { return getValue("slide") },
        set slide(val) { setValue("slide", val) },
        get climbFrame() { return getValue("climbFrame") },
        set climbFrame(val) { setValue("climbFrame", val) },
    },
    get ants() { return getValue("ants") },
    set ants(count) { setValue("ants", count) },
    get caveDepth() { return getValue("pathDistance") },
    set caveDepth(val) { setValue("pathDistance", val) },
    get answer() { return getValue("answer") },
    set answer(count) { setValue("answer", count) },
    get isAnimating() { return getValue("isAnimating") },
    set isAnimating(bool) { setValue("isAnimating", bool) },
    get ok() { return getValue("ok") },
    set ok(bool) { setValue("ok", bool) },
    get slideCount() { return getValue("slideCount") },
    set slideCount(val) { setValue("slideCount", val) },
}
const FACING_RIGHT = 0;
const FACING_LEFT = 1;

function ggbOnInit() {}

async function animate(animationFunction, step) {
    for (let percent = 0; percent <= 1; percent += step) {
        let { x, y, rotation } = animationFunction(percent);

        game.hedgehog.position = {x, y};
        game.hedgehog.rotation = rotation;
        await sleep(50);
    }
}

function sleep(ms) { return new Promise(resolve => setTimeout(resolve, ms)); }

async function enterCave() {
    game.hedgehog.orientation = FACING_RIGHT;
    await animate(walkAnimation, 0.05);
    happySFX.play();
    await animate(jumpAndSlideAnimation, 0.03);
}

async function eatAnts() {
    eatingSFX.play();
    game.ants = 1;
    await sleep(1300);
    eatingSFX.play();
    game.ants = 0;
    await sleep(800);
}

async function leaveCave() {
    let position = game.hedgehog.position.x;
    let speed = game.hedgehog.speed;
    let slide = game.hedgehog.slide;
    let caveDepth = game.caveDepth;
    let climbStep = game.pathDistance * speed / caveDepth;
    let slideStep = game.pathDistance * slide / caveDepth;
    let climbDistance = 0;
    game.hedgehog.orientation = FACING_LEFT;
    game.hedgehog.rotation = 330;

    while (climbDistance < caveDepth) {
        await sleep(200);
        await animate(getClimbAnimation(position, climbStep), Math.round(caveDepth / speed) / 100);
        position -= climbStep;
        climbDistance += speed;

        if (climbDistance < caveDepth) {
            climbSFX.currentTime = 0;
            climbSFX.pause();
            slideSFX.play();

            await animate(getSlideAnimation(position, slideStep), 0.1);
            position += slideStep;
            climbDistance -= slide;
            game.slideCount += 1;
        }
    }

    await animate(finishClimbingAnimation, 0.1)
}

function walkAnimation(percent) {
    climbSFX.play();
    game.hedgehog.climbFrame = (game.hedgehog.climbFrame + 1) % 2;
    return { x: -1.82 + 2.7 * percent , y: 0.35, rotation: 350 };
}

function jumpAndSlideAnimation(percent) {
    if (percent < 0.4) {
        let t = percent / 0.4;

        if (t < 0.25) {
            return { x: -3.44 * t ** 3 + 2.83 * t + 0.88, y: -14.52 * t ** 3 + 4.17 * t + 0.23, rotation: 350 + 40 * t };
        } else {
            return { x: 1.16 * t ** 3 - 3.48 * t ** 2 + 3.71 * t + 0.81, y: 4.9 * t ** 3 - 14.7 * t ** 2 + 7.88 * t - 0.08, rotation: 360 - 20 * t };
        }
    } else {
        let x = 2.2 + 3.5 * (percent - 0.4);
        let y = (5.47 - 5.38 * x) / 3.18;
        return { x, y, rotation: 340 + 10 * percent };
    }
}

function getClimbAnimation(position, amountToClimb) {
    return (percent) => {
        let x = position - amountToClimb * percent;
        let y = (5.47 - 5.38 * x) / 3.18;

        game.hedgehog.climbFrame = (game.hedgehog.climbFrame + 1) % 2;
        climbSFX.play();

        return { x, y, rotation: 330 };
    }
}

function getSlideAnimation(position, amountToSlide) {
    return (percent) => {
        let x = position + amountToSlide * percent;
        let y = (5.47 - 5.38 * x) / 3.18;

        return { x, y, rotation: 330 };
    }
}

function finishClimbingAnimation(percent) {
    let x = 0.75 - 0.1 * percent;
    let y = (5.47 - 5.38 * x) / 3.18;
    return { x, y, rotation: 330 + 20 * Math.min(percent * 2, 1) };
}

function newGame() {
    let newSpeed = Math.floor(Math.random() * 15) + 5;
    let newSlide = Math.floor(Math.random() * (newSpeed - 2)) + 1;
    let newCaveDepth = Math.floor(Math.random() * 7 + 2) * (newSpeed - newSlide) + newSpeed;

    game.hedgehog.speed = newSpeed;
    game.hedgehog.slide = newSlide;
    game.caveDepth = newCaveDepth;
    game.hedgehog.orientation = FACING_RIGHT;
    game.hedgehog.position = { x: -1.82, y: 0.35 }
    game.hedgehog.rotation = 350;
    game.ok = undefined;
    game.answer = 0;
    game.ants = 2;
    game.slideCount = 0;
}

function incrementAnswer() {
    game.answer = Math.min(game.answer + 1, 9);
}

function decrementAnswer() {
    game.answer = Math.max(game.answer - 1, 0);
}

async function check() {
    let speed = game.hedgehog.speed;
    let isCorrect = game.answer === (game.caveDepth - speed) / (speed - game.hedgehog.slide);
    game.isAnimating = true;

    await enterCave();
    await sleep(400);
    await eatAnts();
    await sleep(400);
    await leaveCave();

    game.ok = Number(isCorrect);
    game.isAnimating = false;

    if (isCorrect) correctSFX.play();
    else wrongSFX.play();
}

let slideSFX = new Audio("data:audio/wav;base64,");
let climbSFX = new Audio("data:audio/mp4;base64,");
let happySFX = new Audio("data:audio/mp4;base64,");
let eatingSFX = new Audio("data:audio/mpeg;base64,");
let wrongSFX = new Audio("data:audio/mpeg;base64,");
let correctSFX = new Audio("data:audio/mpeg;base64,");